In Druid, most container widgets expect their children to have the same associated data. If you have a Flex<Foobar>, you can only append widgets that implement Widget<Foobar> to it. In some cases, however, you want to compose widgets that operate on different subsets of the data. Maybe you want to add two widgets to the above Flex, one that uses the field foo and another that uses the field bar, and they might respectively implement Widget<Foo> and Widget<Bar>. Lenses allow you to bridge that type difference. A lens is a type that represents a two-way mapping between two data types. That is, a lens from X to Y can take an instance of X and give you an instance of Y, and can take a modified Y and apply the modification to X. To expand on our Foobar example: #[derive(Lens)]
struct Foobar { foo: Foo, bar: Bar,
} The derive macro above generates two lenses: Foobar::foo and Foobar::bar. Foobar::foo can take an instance of Foobar and give you a shared or mutable reference to its foo field. Finally, the type LensWrap can take that lens and use it to map between different widget types: fn build_foo() -> impl Widget<Foo> { // ...
} fn build_bar() -> impl Widget<Bar> { } fn build_foobar() -> impl Widget<Foobar> { Flex::column() .with_child( LensWrap::new(build_foo(), Foobar::foo), ) .with_child( LensWrap::new(build_bar(), Foobar::bar), )
