As an example, let's write a manual implementation of the Lens trait: struct Container { inner: String, another: String,
} // This lens doesn't have any data, because it will always map to the same field.
// A lens that mapped to, say, an index in a collection, would need to store that index.
struct InnerLens; // Our lens will apply functions that operate on a `String` to a `Container`.
impl Lens<Container, String> for InnerLens { fn with<F: FnOnce(&String)>(&self, data: &Container, f: F) { f(&data.inner); } fn with_mut<F: FnOnce(&mut String)>(&self, data: &mut Container, f: F) { f(&mut data.inner); }
} The implementation is straightforward: it projects the given function onto the inner field of our struct. (Notice that this isn't the only valid lens from Container to String we could have made - we could also project from Container to another). You'll also notice that both methods take an immutable reference to self, even the mut variant. The lense itself should be thought of as a fixed value that knows how to do the mapping. In the above case it contains no data, and will likely not even be present in the final compiled/optimized code. Now for a slightly more involved example struct Container2 { first_name: String, last_name: String, age: u16, // in the future maybe people will live past 256?
} struct Name { first: String, last: String,
} struct NameLens; impl Lens<Container2, Name> for NameLens { fn with<F: FnOnce(&Name)>(&self, data: &Container2, f: F) { let first = data.first_name.clone(); let last = data.last_name.clone(); f(&Name { first, last }); } fn with_mut<F: FnOnce(&mut Name)>(&self, data: &mut Container2, f: F) { let first = data.first_name.clone(); let last = data.last_name.clone(); let mut name = Name { first, last }; f(&mut name); data.first_name = name.first; data.last_name = name.last; }
} Side note: if you try doing this with struct Name<'a> { first: &'a String, ..., you'll find that it's not possible to be generic over the mutability of the fields in Name, so we can't make the Name struct borrow the data both mutably and immutably. Even if we could in this case, things quickly get very complicated. Also, sometimes Widgets need to keep a copy of the data around for use internally. For now the accepted best practice is to make Cloneing cheap and use that. Now as I'm sure you've realised, the above is very inefficient. Given that we will be traversing our data very often, we need it to be cheap. (This wasn't a problem before, because when we don't need to build the inner type, we can just use references. It also wouldn't be a problem if our data was cheap to copy/clone, for example any of the primitive number types u8, ... f64.) Luckily, this is exactly the kind of thing that rust excels at. Let's rewrite the above example to be fast! struct Container2 { first_name: Rc<String>, last_name: Rc<String>, age: u16,
} struct Name { first: Rc<String>, last: Rc<String>,
} struct NameLens; impl Lens<Container2, Name> for NameLens { // .. identical to previous example
} As you'll see, we've introduced Rc: the reference-counted pointer. You will see this and its multithreaded cousin Arc used pervasively in the examples. Now, the only time we actually have to copy memory is when Rc::make_mut is called in the f in with_mut. This means that in the case where nothing changes, all we will be doing is incrementing and decrementing reference counts. Moreover, we give the compiler the opportunity to inline f and with/with_mut, making this abstraction potentially zero-cost (disclaimer: I haven't actually studied the produced assembly to validate this claim). The trade-off is that we introduce more complexity into the Name type: to make changes to the data we have to use Rc::make_mut to get mutable access to the String. (The code in the lens will ensure that the newer copy of the Rcd data is saved to the outer type.) This means the writing fast druid code requires knowledge of the Rust pointer types (Rc/Arc, and also potentially RefCell/Mutex). We can actually do even better than this. Suppose that we are working on a vector of data rather than a string. We can import the im crate to get collections that use structural sharing , meaning that even when the vector is mutated, we only Clone what we need to. Because im is so useful, it is included in druid (behind the im feature). struct Container2 { // Pretend that it's the 1980s and we store only ASCII names. first_name: im::Vector<u8>, last_name: im::Vector<u8>, age: u16,
} struct Name { first: im::Vector<u8>, last: im::Vector<u8>,
} struct NameLens; impl Lens<Container2, Name> for NameLens { // .. identical to previous example
} Now in addition to almost free Clones, we also have cheap incremental updates to the data itself. That means your UI won't get slowdowns if your data structure gets very large (eg a list of entries in a database). Hopefully, this makes sense to you. This was a technical overview of lenses as generic data structures. The next section will cover how lenses are integrated in Druid in more detail.

