The most prominent role of Env is to store a set of typed keys and values. The Env can only store a few types of things; these are represented by the Value type, which looks like this: pub enum Value { Point(Point), Size(Size), Rect(Rect), Insets(Insets), Color(Color), Float(f64), Bool(bool), UnsignedInt(u64), String(ArcStr), Font(FontDescriptor), RoundedRectRadii(RoundedRectRadii), Other(Arc<dyn Any + Send + Sync>),
} The only way to get an item out of the Env is with a Key . A Key is a combination of a string identifier and a type. You can think of this as strict types, enforced at runtime. It is the programmer's responsibility to ensure that the key used to get a value has the same type as the one used to set it . The API is aggressive about checking for misuse, and many methods will panic if anything is amiss. In practice this shouldn't almost never happen if you follow these guidelines: Keys should be consts with unique names. If you need to use a custom key, you should declare it as a const, and give it a unique name. By convention, you should namespace your keys using something like reverse-DNS notation, or even just prefixing them with the name of your app. const BAD_NAME: Key<f64> = Key::new("height");
const GOOD_NAME: Key<f64> = Key::new("com.example.my-app.main-view-height"); Keys must always be set before they are used. In practice this means that most keys are set when your application launches, using AppLauncher::configure_env . Once a key has been added to the Env, it cannot be deleted, although it can be overwritten. Values can only be overwritten by values of the same type. If you have a Key<f64>, assuming that key has already been added to the Env, you cannot replace it with any other type. Assuming these rules are followed, Env should just work.

